import styled from "styled-components";
import LogoImage from '../../assets/image/logo.png';

const Header = () => {
    
    return (
        <BtnLogo><img src={LogoImage} alt="logo"/></BtnLogo>
    );
}



const BtnLogo = styled.button`
    width: 175px;
    height: 79px;
`;

export default Header;
